import React from 'react'
import classes from './Profile.module.css'

const Profile = (props) => {
    return (
        <div>
            <div className={classes.image}>
                <span className={classes.name}>{props.name}</span>
                <img src={props.imageSrc} alt="" />
            </div>
        </div>
    )
}

export default Profile
